My Dad's Hot Girlfriend - Brynn Tyler 

Actors: Brynn Tyler, Dane Cross

Release Date: February 1st, 2011

Dane is off to go boogie-boarding with some friends when his dad's younger girlfriend, Brynn, stops him on his way out and asks if she can tag along. He asks about her dinner date with his father, but Brynn says his dad will probably just be too tired. When Dane suggests she start dating someone her own age, Brynn agrees and sticks her tits in his face, only to soon be sitting on his face.
